import React from 'react';
import './Navbar.css';

const Navbar = ({ onCallForHelp, onDonateGoods, onBack, onEmergencyContacts, onChecklist }) => {
  return (
    <div className="nav-bar">
      <h2>SalbaBida</h2>
      <button className="nav-button" onClick={onCallForHelp}>Call for Help</button>
      <button className="nav-button" onClick={onDonateGoods}>Donate Goods</button>
      <button className="nav-button" onClick={onEmergencyContacts}>Emergency Contacts</button>
      <button className="nav-button" onClick={onChecklist}>Disaster Preparedness Checklist</button>
      <button className="back-button" onClick={onBack}>Back</button>
    </div>
  );
};

export default Navbar;
